@Override
public void init(Map<String, String> args) {
  super.init(args);

  if (args.get(INJECT) != null) {
    inject = Boolean.getBoolean(args.get(INJECT));
  }

  if (args.get(MAX_CODE_LENGTH) != null) {
    maxCodeLength = Integer.parseInt(args.get(MAX_CODE_LENGTH));
  }
}

